svg.script:
function likesChange(){
if(document.getElementsByClassName("iconHeart")[0].className.baseVal == "iconHeart liked"){
likeNum = document.getElementById("likes").innerHTML.slice(0,document.getElementById("likes").innerHTML.indexOf(" "));
document.getElementById("likes").innerHTML = Number(likeNum) + 1 + " Likes";
}else{
likeNum = document.getElementById("likes").innerHTML.slice(0,document.getElementById("likes").innerHTML.indexOf(" "));
document.getElementById("likes").innerHTML = Number(likeNum) - 1 + " Likes";
}
}
